import React, { Component } from 'react'
import Blog1 from './Blog1'
import Blog2 from './Blog2'

export default class Blog extends Component {
    render() {
        return (
            <div>
                <h2>Blog </h2>
                <Blog1 />
                <Blog2 />
            </div>
        )
    }
}
